import TweetElement from "./componets/TweetElement";
import Header from "./componets/Header"

function App() {
  return (
    <div>
      <div className="header">
          <Header/>
      </div>
      <div className="main-container">
        <div className="sidebar">

        </div>
        <div className="main-content">
            <TweetElement/>
        </div>
      </div>
    </div>
  );
}

export default App;
